import React from "react";
import './App.css';
import { BrowserRouter as Router, Link, Route, Switch,} from 'react-router-dom';
import IP_PlaneComponent from "./IP_PlaneComponent";
import IP_SpainComponent from "./IP_SpainComponent";
import IP_PortugalComponent from "./IP_PortugalComponent";
import IP_OverComponent from "./IP_OverComponent";
import IP_EntryComponent from "./IP_EntryComponent";
import PlaneComponent from "./IP_PlaneComponent";

class App extends React.Component {

  constructor(props){
    super(props);
    this.state = {
      showPlanesComponent: true,
      icao24ID: ""
    }
  }

  render(){
      return (

          <div className="App">
                <nav>
                    <Link to="/planes">Planes</Link>
                    <Link to="/planes/ip">IP</Link>
                </nav>
                <Route
                    path="/planes"
                    component={PlaneComponent}
                    exact 
                />
                <Route
                    path="/dashboard"
                    component={IP_PlaneComponent} 
                />
            </div>
      );
    }
}

export default App;
